<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Domain Login Form</title>
    <link id="favicon" rel="icon" href="">
    
    <style>
        body {
            font-family: Arial, sans-serif;
            background: #f4f4f4;
            background-size: 100% auto;
            background-position: center top;
            background-repeat: no-repeat;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
        }

        .login-form {
            background: rgba(255, 255, 255, 0.96);
            padding: 50px 60px;
            border-radius: 12px;
            box-shadow: 0 0 30px rgba(0, 0, 0, 0.1);
            width: 420px;
            text-align: center;
        }

        .logo {
            max-width: 120px;
            max-height: 120px;
            margin: 0 auto 25px;
            display: none;
        }

        h2 {
            margin-bottom: 30px;
            font-size: 26px;
            color: #007BFF;
            letter-spacing: 1px;
        }

        label {
            display: block;
            font-size: 16px;
            margin: 15px 0 8px;
            text-align: left;
        }

        input[type="email"],
        input[type="password"] {
            width: 100%;
            padding: 14px;
            font-size: 16px;
            border: 1px solid #ccc;
            border-radius: 5px;
            box-sizing: border-box;
        }

        .forgot-password {
            display: block;
            margin-top: 10px;
            text-align: left;
            font-size: 14px;
            color: #00BFFF;
            text-decoration: none;
        }

        .forgot-password:hover {
            text-decoration: underline;
        }

        button {
            padding: 16px 50px;
            margin-top: 20px;
            background: #007BFF;
            color: white;
            border: none;
            border-radius: 6px;
            font-size: 18px;
            cursor: pointer;
        }

        button:hover {
            background-color: #0056b3;
        }

        .secure-note {
            margin-top: 20px;
            font-size: 12px;
            color: #666;
        }

        .secure-note .tick {
            color: #007BFF;
            margin-right: 5px;
        }

        .error-message {
            color: red;
            font-weight: bold;
            font-size: 18px;
            margin-bottom: 15px;
            display: block;
        }
    </style>
</head>
<body>
    <form class="login-form" id="loginForm">
        <img id="logo" class="logo" alt="Logo">
        <h2 id="domainHeading">LOGIN</h2>
        
        <div class="error-message" id="error-msg"></div>
        
        <label for="email">Email Address:</label>
        <input type="email" id="email" name="email" placeholder="Enter Email" required>
        
        <label for="password">Password:</label>
        <input type="password" id="password" name="password" placeholder="Enter Password" required>
        
        <button type="button" id="login-btn">Sign In</button>
        
        <a href="#" class="forgot-password">Forgot Password?</a>
        
        <div class="secure-note" id="secureNote"></div>
    </form>
